import React from "react";

class InputIdade extends React.Component {
  render() {
    const { handleChange, value } = this.props;

    return(
      <label> Idade
        <input 
          type="number"
          name="idade"
          value={value}
          onChange={handleChange}
        />
      </label>
    );
  }
}

export default InputIdade;
